import PropTypes from "prop-types";
const List = ({books, title}) =>{
    return <div>
        {!title ? 
            (<></>) 
            : 
            (<h2 className="bookshelf-title">{title}</h2>)
        }        
        {books.map((book) => <div>{book.title}</div>)}
    </div>
};
List.propTypes = {
    books: PropTypes.array.isRequired,
    title: PropTypes.string
};
export default List;
